import React from "react"; 
import ContactMe from "./contactMe.component";
import MessageMe from "./messageMe.component";

const Contact = () => {
    return(
        <div>
            <div><ContactMe/></div>
            
            <div><MessageMe/></div>
        </div>
    )
}

export default Contact;
